import { Text } from "react-native";
import { CalendarIcon, GraphIcon, HomeIcon } from "../../components/icons";
import DateNavigation from "./date-navigation";
import Exercises from "./exercises";

const sections = [
    {link: "/", icon: <HomeIcon/>},
    {link: "/calendar", icon: <CalendarIcon/>},
    {link: "/statistics", icon: <GraphIcon/>},
];

const DayWorkout = () => {
    return (<>
        <DateNavigation/>
        {sections.map(s =>
            <Text>{s.icon}</Text>
        )}
        <Exercises/>
    </>);
}

export default DayWorkout;
